import React, { useState, useEffect } from "react";

function BookingHistory({ userId }) {
  const [bookings, setBookings] = useState([]);

  useEffect(() => {
    // Fetch bookings data from API using userId
    fetch(`/api/bookings?userId=${userId}`)
      .then((response) => response.json())
      .then((data) => setBookings(data));
  }, [userId]);

  return (
    <div>
      <h2>Booking History</h2>
      <table>
        <thead>
          <tr>
            <th>Date</th>
            <th>Duration</th>
            <th>Parking Lot</th>
            <th>Spot Number</th>
          </tr>
        </thead>
        <tbody>
          {bookings.map((booking) => (
            <tr key={booking.id}>
              <td>{booking.date}</td>
              <td>{booking.duration} hours</td>
              <td>{booking.lotName}</td>
              <td>{booking.spotNumber}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default BookingHistory;
